INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("やったね、ぷうきち！\nこれならお兄ちゃんたちの\nお手本になれたよね！", 0.0, 0.0, "2020/07/31 12:00:00", 102301, 2, 0.0, 401, 2, 10046, 24, "アヤネ", "2030/12/17 14:59:59", 24001);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("私たちの勝ちだね！\nぷうきちと一緒なら\nどんなボールでも\nホームランを打ってみせるよ！", 0.0, 2.21, "2020/07/31 12:00:00", 102301, 2, 0.0, 402, 1, 10046, 24, "アヤネ", "2030/12/17 14:59:59", 24002);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("やったやったぁ！\nお兄ちゃん、見ててくれた？\n私、すっごくがんばったよ！", 0.0, 0.0, "2020/07/31 12:00:00", 102301, 2, 0.0, 403, 2, 10046, 24, "アヤネ", "2030/12/17 14:59:59", 24003);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("特訓の成果が出たみたいだ！\nもっと練習を重ねて\nこの調子で上達していこう！", 0.0, 1.99, "2020/07/31 12:00:00", 192201, 1, 0.0, 701, 2, 10046, 24, "アサヒ", "2030/12/17 14:59:59", 24004);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("よし、いい感じだ！\nキャプテンとしての仕事は\nきっちり果たせそうだよ", 0.0, 2.21, "2020/07/31 12:00:00", 192201, 2, 0.0, 702, 1, 10046, 24, "アサヒ", "2030/12/17 14:59:59", 24005);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("試合に向けて\nいい感覚を掴めた気がするよ！\nこのまま一気に全国大会だ！", 0.0, 3.33, "2020/07/31 12:00:00", 192201, 1, 0.0, 703, 2, 10046, 24, "アサヒ", "2030/12/17 14:59:59", 24006);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("このくらい余裕だ\nオレたちは全国大会を\n目指してるんだからな", 0.0, 0.0, "2020/07/31 12:00:00", 192301, 2, 0.0, 801, 2, 10046, 24, "部員３", "2030/12/17 14:59:59", 24007);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("オレだって\nビーチベースボール選手だ\nどんな球だろうが\n全部スタンドまで飛ばしてやる", 0.0, 2.68, "2020/07/31 12:00:00", 192301, 2, 0.0, 802, 1, 10046, 24, "部員３", "2030/12/17 14:59:59", 24008);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("いい感じだ\nこれなら試合でも活躍できそうだ\n大暴れしてやる！", 0.0, 0.0, "2020/07/31 12:00:00", 192301, 2, 0.0, 803, 2, 10046, 24, "部員３", "2030/12/17 14:59:59", 24009);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("やった！", 0.0, 0.0, "2020/07/31 12:00:00", 192501, 1, 0.0, 501, 1, 10046, 24, "", "2030/12/17 14:59:59", 24010);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("勝ったよ！", 0.0, 0.0, "2020/07/31 12:00:00", 192501, 1, 0.0, 502, 1, 10046, 24, "", "2030/12/17 14:59:59", 24011);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("いい調子！", 0.0, 0.0, "2020/07/31 12:00:00", 192501, 1, 0.0, 503, 1, 10046, 24, "", "2030/12/17 14:59:59", 24012);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("あら～…もしかして\n勝っちゃったのかしら？\nみんなの練習を見ていたから\nかもしれないわね", 0.0, 5.33, "2020/07/31 12:00:00", 113501, 2, 0.0, 111, 6, 10046, 24, "ミサト", "2030/12/17 14:59:59", 24013);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("みんなの力になりたくて\n先生も頑張ってみました～！\nうまく投げられたみたいで\nよかったわ～！", 0.0, 6.85, "2020/07/31 12:00:00", 113501, 2, 0.0, 112, 1, 10046, 24, "ミサト", "2030/12/17 14:59:59", 24014);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("練習お疲れさま～！\n先生も協力できて\nとってもうれしいわ～♪\n次も頑張りましょうね～！", 0.0, 3.0, "2020/07/31 12:00:00", 113501, 2, 0.0, 113, 1, 10046, 24, "ミサト", "2030/12/17 14:59:59", 24015);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("まだ練習が足りねえみてえだな\nこれっぽっちも本気で\n投げてねえっつーの\nもう一回やんぞ！", 0.0, 6.11, "2020/07/31 12:00:00", 192401, 2, 0.0, 611, 1, 10046, 24, "ダイチ", "2030/12/17 14:59:59", 24016);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("ふん、当然の結果だな\n俺の球は、誰にも打てねえよ！\nまたやりてえっつーなら\nとことん付き合ってやるぜ！", 0.0, 6.75, "2020/07/31 12:00:00", 192401, 2, 0.0, 612, 1, 10046, 24, "ダイチ", "2030/12/17 14:59:59", 24017);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("おっしゃあ！\nこの勢いで全国に行ってやるぜ！\n全員三振で仕留めてやる！", 0.0, 0.0, "2020/07/31 12:00:00", 192401, 2, 0.0, 613, 2, 10046, 24, "ダイチ", "2030/12/17 14:59:59", 24018);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("きらーん☆\nハツネちゃんの大勝利なのだ～！\nみんながもっと上達できるように\n私もまだまだ頑張るからね！", 0.0, 4.52, "2020/07/31 12:00:00", 113401, 1, 0.0, 211, 2, 10046, 24, "ハツネ", "2030/12/17 14:59:59", 24019);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("やったあ！　私の勝ちだね！\nチアリーダーもピッチャーも\nハツネちゃんに任せてよ！", 0.0, 3.89, "2020/07/31 12:00:00", 113401, 1, 0.0, 212, 2, 10046, 24, "ハツネ", "2030/12/17 14:59:59", 24020);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("よお～し、この調子でもっと\n頑張ろう…と思ったけど\n超能力を使ったから…\n眠くなってきちゃった…すやぁ…", 0.0, 13.49, "2020/07/31 12:00:00", 113401, 2, 0.0, 213, 1, 10046, 24, "ハツネ", "2030/12/17 14:59:59", 24021);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("いい勝負だったぜ！\nたぎっちまって\nつい本気で投げちまったよ", 0.0, 3.17, "2020/07/31 12:00:00", 106501, 2, 0.0, 311, 1, 10046, 24, "カヤ", "2030/12/17 14:59:59", 24022);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("どうだ？\nオレ様のボールは熱かっただろ！\nま、でもおまえらの根性も\nなかなかのもんだったぜ", 0.0, 4.42, "2020/07/31 12:00:00", 106501, 2, 0.0, 312, 1, 10046, 24, "カヤ", "2030/12/17 14:59:59", 24023);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("なんだよ、そんなもんか？\nこっちはまだまだ投げたりねえ\nもっと勝負しようぜ！", 0.0, 2.89, "2020/07/31 12:00:00", 106501, 1, 0.0, 313, 6, 10046, 24, "カヤ", "2030/12/17 14:59:59", 24024);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("あとちょっとだったのに～！\n次こそぷうきちと一緒に\n勝ってみせるからね！", 0.0, 3.71, "2020/07/31 12:00:00", 102301, 3, 0.0, 421, 4, 10046, 24, "アヤネ", "2030/12/17 14:59:59", 24025);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("いい勝負だったね！\nでも、やっぱり悔しいな…\nもっと練習して\n今度は絶対に俺が勝つから！", 0.0, 5.1, "2020/07/31 12:00:00", 192201, 1, 0.0, 721, 2, 10046, 24, "アサヒ", "2030/12/17 14:59:59", 24026);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("ちっ…あと一歩足りなかったか\n次こそは絶対に勝つから\nそのつもりでいろ", 0.0, 4.34, "2020/07/31 12:00:00", 192301, 3, 0.0, 821, 1, 10046, 24, "部員３", "2030/12/17 14:59:59", 24027);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("いい勝負だったよ\nまたやろうね", 0.0, 0.0, "2020/07/31 12:00:00", 192501, 1, 0.0, 521, 1, 10046, 24, "", "2030/12/17 14:59:59", 24028);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("とってもよくできました～♪\n頑張ってくれて先生うれしいわ\nこれからも試合に向けて\n練習していきましょうね～", -360.0, 5.62, "2020/07/31 12:00:00", 113501, 2, 0.0, 101, 1, 10046, 24, "ミサト", "2030/12/17 14:59:59", 24029);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("頑張った成果ね～！\nこのまま練習を続ければ\nもっとすごい成績を残せそうよ\n期待してますからね～！", -360.0, 9.58, "2020/07/31 12:00:00", 113501, 2, 0.0, 102, 1, 10046, 24, "ミサト", "2030/12/17 14:59:59", 24030);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("いい子、いい子～♪\n頑張り屋さんのあなたを\nたっくさん褒めてあげますからね", -360.0, 0.0, "2020/07/31 12:00:00", 113501, 2, 0.0, 103, 2, 10046, 24, "ミサト", "2030/12/17 14:59:59", 24031);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("夢に向けて、一歩前進できたわね\nこの調子で、夢を叶えましょう\n目指せ、全国大会～！", -360.0, 9.13, "2020/07/31 12:00:00", 113501, 1, 0.0, 104, 2, 10046, 24, "ミサト", "2030/12/17 14:59:59", 24032);
INSERT INTO `v1_af0ffb8fef7d91701db82840d1fc5276592fbc6fd9ae0c602f7734a943dabed2` VALUES ("絶好調ね～♪\nきっと試合でも大活躍\n間違いなしだわ\n楽しみにしていますからね～！", -360.0, 8.27, "2020/07/31 12:00:00", 113501, 2, 0.0, 105, 1, 10046, 24, "ミサト", "2030/12/17 14:59:59", 24033);
